--
-- Table structure for table `players`
--

DROP TABLE IF EXISTS `players`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `players` (
  `id` int NOT NULL AUTO_INCREMENT,
  `player` varchar(50) NOT NULL,
  `bday` date NOT NULL,
  `rank` int NOT NULL,
  `city` varchar(255) NOT NULL,
  `region` varchar(255) NOT NULL,
  `razryad` varchar(255) NOT NULL,
  `coach_id` int NOT NULL,
  `mesto` int DEFAULT NULL,
  `full_name` varchar(255) NOT NULL,
  `title_id` int NOT NULL,
  `pay_rejting` varchar(50) NOT NULL,
  `comment` varchar(255) NOT NULL,
  `coefficient_victories` float NOT NULL,
  `total_game_player` int NOT NULL,
  `total_win_game` int NOT NULL,
  `application` varchar(30) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `player_coach_id` (`coach_id`),
  KEY `player_title_id` (`title_id`),
  CONSTRAINT `players_ibfk_1` FOREIGN KEY (`coach_id`) REFERENCES `coachs` (`id`),
  CONSTRAINT `players_ibfk_2` FOREIGN KEY (`title_id`) REFERENCES `titles` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=367 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

